INSERT INTO `blogs` VALUES (11,'Mac Miller passed away yesterday. Today I have spent over ten hours working on knowyourcosmos dashboard. At this point everything is working but the creation of missions. I am currently showing Bobandi the website. Looking forward to changing the world.{n}{n}Cheers.','beerent','2018-09-09 00:55:03',1),(12,'Need to add feature to have numbers with powers','Nick','2018-09-09 00:59:55',0),(13,'<i>What you do today is who you are tomorrow.</i>{n}{n}I am reworking all of the code organization to become less coupled (forced to need all files to do one task) and more cohesive (related files are placed nearby). We will create the highest quality of work, even if only for internal uses. Because what we do today determines who we are tomorrow.','beerent','2018-09-09 13:54:48',1),(14,'I am logging in to check out all the important updates to make this easier!','Bob','2018-09-10 00:17:51',1),(15,'Showing off blog system to screen share. ','ghost','2018-09-10 00:47:08',0),(16,'Here teammates are encouraged to share their thoughts on the day. ','Beerent','2018-09-10 00:48:44',0),(17,'When entering question, special characters such as underscores, quotation marks and apostrophes will result in the question not being saved. ','Bob','2018-09-10 10:39:37',0),(18,'There should be an option for True or False questions. So essentially when adding new questions there should be an option, this is a T/F question and auto fill T/F as answers.','Bob','2018-09-11 10:48:31',0),(19,'Just as a reminder to log my IP Address. It changed today.','Bob','2018-09-12 10:13:12',1),(20,'Today I was extremely tired. I had literally one beer in celebration of ginger getting rich from new job. It\'s crazy what one beer can do to your drive and effectiveness. No beer is the best beer when you need to get sh*t done!','beerent','2018-09-12 11:01:06',1),(21,'I am happy!','brent','2018-09-13 01:11:53',0),(22,'well over a week in and we\'re still making great momentum. This feels amazing. Also, waking up at 4 am is starting to feel normal! My gym interest has suffered, which ends today. I will workout at 6:30 am for now on.','beerent','2018-09-14 09:47:18',1),(23,'Woke up before my alarm went off this morning which was unusual. 350AM felt ok, wasn\'t too tired. Went to the gym, came home and ran 4 miles all before 6AM. ','Bob','2018-09-14 10:16:38',1),(24,'A wonderful Saturday! Just brought Kamil on board. He has joined the slack channel. I also created my 3rd aws server to host perforce. Yesterday we decided we are going to use Kamil\'s old space game for a background on know your cosmos!','beerent','2018-09-15 14:06:09',1),(25,'It\'s the end of Sunday. We are putting in serious work! Bob just finished the Sun, I just finished the Moon. Excited to see what the next week brings!','beerent','2018-09-17 00:42:25',1),(26,'test','test','2018-09-17 10:36:09',0),(27,'Its been a great morning. I added citations for the entire Sun bucket!','Bob','2018-09-18 11:14:56',1),(28,'Itâ€™s the morning of the day I fly to Disney. Lol. ','beerent','2018-09-20 09:08:32',1),(29,'Back from LaLa land! Yesterday was first day back from Disney and it sucked ass. Today I was up at 3:50 AM and ready to get back to it!','D. Marshall','2018-09-25 09:22:34',1),(30,'Bae is coming into town tonight. But that isn\'t stopping me from adding more questions before her arrival!','Bob','2018-09-29 02:28:31',1),(31,'Up at 5:30 on the weekend. have been debating going back to bed but sometimes you have to grind!!!','beerent','2018-09-29 10:25:21',1),(32,'Begging the Jupiter bucket...NOW!','Bobandi','2018-10-16 14:40:25',0),(33,'Haven\'t posted in a while! at this point we have network connections running from both windows and ios. we have a staging server running and serving up the 400 questions we have so far. things are exciting!','beerent','2018-10-27 10:39:20',1),(34,'We need to keep pushing to 500 questions and filling all our current buckets to 50 questions!','Bob','2018-10-30 13:04:45',1);
/*!40000 ALTER TABLE `blogs` ENABLE KEYS */;
UNLOCK TABLES;

